function Title(l){return $(l).html("<h1>Weather Animated Elements - Malextrap</h1>")}function Sun(l){return $(l).html("<span class='sun'></span><span class='sunx'></span>")}function Cloud(l){return $(l).html("<span class='cloud'></span><span class='cloudx'></span>")}function Snow(l){return $(l).html("<ul><li></li><li></li><li></li><li></li><li></li><li></li><li></li><li></li></ul><span class='snowe'></span><span class='snowex'></span><span class='stick'></span><span class='stick2'></span>")}function Rain(l){return $(l).html("<ul><li></li><li></li><li></li><li></li><li></li></ul><span class='cloudr'></span>")}function Night(l){return $(l).html("<span class='moon'></span><span class='spot1'></span><span class='spot2'></span><ul><li></li><li></li><li></li><li></li><li></li></ul>")}const title="#title",sun=".hot",cloud=".cloudy",snow=".snowy",rain=".rain",night=".night";$(document).ready(function(){new Main});var Main=function(){Title(title),Sun(sun),Cloud(cloud),Snow(snow),Rain(rain),Night(night)};
